features.script:
setInterval(() => {
  let p = parcel.getPlayers()[0]

  if (!p) {
    return
  }

  let v1 = feature.position
  let v2 = p.position
  let angle = Math.atan2(v1.z - v2.z, v1.x - v2.x)

  feature.rotation.y = Math.PI / -2 - angle
}, 200)

let msg = parcel.getFeatureById('welcometxt')

parcel.on('playerenter', event => {
  msg.set({text:"Welcome"})
  feature.set({text:event.player.name})

  console.log(event.player.name)
})

parcel.on('playerleave', event => {
  msg.set({text:"Goodbye"})
  feature.set({text:event.player.name})

  console.log(event.player.name)
})

let right=true // Acts as a switch (if true: go left, if false: go right)

setInterval(()=>{ // Starts intervals
    if(right){
    feature.position.z = feature.position.z + 0.25 // move to the left (or north)
    right = !right
  }else{
    feature.position.z = feature.position.z - 0.25 // move to the right (or south)
    right = !right
  }
},1000)
